import { Fragment } from "react";
import MainNavigation from "./MainNavigation";
import styles from './Layout.module.css';
const Layout = (props) => {
    return (
        <Fragment>
            <MainNavigation>
                <main className={styles.main}>{props.children}</main>
            </MainNavigation>
        </Fragment>
    );
};

export default Layout;
